import React, { Component } from "react";
import LoginSignUp_UI from "./LoginSignUp_UI";

class LoginSignUp extends Component {
  constructor(props) {
    super();
    this.state = props;
    console.log(this.state);
    this.handleLogin = this.handleLogin.bind(this)
  }

  handleLogin(dt) {
    console.log("success")
  }
  render() {
    return (
      <LoginSignUp_UI state
        event={handleLogin} />
    )
  }
}
export default LoginSignUp;
